int main(void)
{
	
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    // declare other variables(not shown)
    // initialize location and direction of rectangles(not shown)

    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
     // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer
     // pixel_buffer_start points to the pixel buffer

	generatePattern();
	clear_screen();
	titleScreen();
	wait_for_vsync(); // swap front and back buffers on VGA vertical sync
	pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
	int gameStarted = 0;
	int isGameOver = 0;
	unsigned char byte1 = 0;
	unsigned char byte2 = 0;
	unsigned char byte3 = 0;
	volatile int * KEY_ptr = (int *)KEY_BASE;
	volatile int * SW_ptr = (int *)SW_BASE;
	int KEY_value = *(KEY_ptr);
	int SW_value = *(SW_ptr);
	
  	volatile int * PS2_ptr = (int *) 0xFF200100;  // PS/2 port address

	int PS2_data, RVALID;

	while (1) {
		PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
		RVALID = (PS2_data & 0x8000);	// extract the RVALID field
		SW_value = *(SW_ptr);		
		if (*KEY_ptr != 0 && gameStarted) // check if any KEY was pressed
		{
			KEY_value = *(KEY_ptr);
			while (*KEY_ptr != 0);
			if(SW_value == 1){
				if(player_sprite < 7){
					player_sprite++;
				}else{
					player_sprite = 0;
				}
			}else if(SW_value == 0){
				if (KEY_value == 0b0001){
					move(RIGHT);
				}
				else if (KEY_value == 0b0010){
					move(LEFT);
				}
				else if (KEY_value == 0b0100){
					move(DOWN);
				}			
				else if (KEY_value == 0b1000){
					move(UP);
				}
			}			
			refresh();
			if(player_health <= 0){
				gameOver();
				gameStarted = 0;
				isGameOver = 1;
			}
			if(gameWon){
				endScreen();
				gameStarted = 0;
			}
			wait_for_vsync(); // swap front and back buffers on VGA vertical sync
			pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer		
		}
		if (*KEY_ptr != 0 && !gameStarted) // check if any KEY was pressed
		{
			while (*KEY_ptr != 0);
			if(isGameOver){
				isGameOver = 0;
			}
			if(gameWon){
				gameWon = 0;
			}
			gameStarted = 1;
			refresh();
			wait_for_vsync(); // swap front and back buffers on VGA vertical sync
			pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		}
		
		if (RVALID && gameStarted) {
			/* shift the next data byte into the display */
			byte1 = byte2;
			byte2 = byte3;
			byte3 = PS2_data & 0xFF;
			//HEX_PS2(byte1, byte2, byte3);
			
			
			
			if ((byte2 == (char)0xAA) && (byte3 == (char)0x00)){
				// mouse inserted; initialize sending of data
				*(PS2_ptr) = 0xF4;
			}
			int input =  0xFFFF & ((byte3 << 8) + byte2);
			switch (input){
			case 0x1DF0:
				move(UP);
				break;
			case 0x1BF0:
				move(DOWN);
				break;
			case 0x1CF0:
				move(LEFT);
				break;
			case 0x23F0:
				move(RIGHT);
				break;
			default:
				break;
			}

			refresh();
			if(player_health <= 0){
				gameOver();
				gameStarted = 0;
				isGameOver = 1;
			}
			if(gameWon){
				endScreen();
				gameStarted = 0;
			}			
			wait_for_vsync(); // swap front and back buffers on VGA vertical sync
			pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		}
	}

}



void HEX_PS2(char b1, char b2, char b3) {
	volatile int * HEX3_HEX0_ptr = (int *)HEX3_HEX0_BASE;
	volatile int * HEX5_HEX4_ptr = (int *)HEX5_HEX4_BASE;
	/* SEVEN_SEGMENT_DECODE_TABLE gives the on/off settings for all segments in
	* a single 7-seg display in the DE1-SoC Computer, for the hex digits 0 - F
	*/
	unsigned char seven_seg_decode_table[] = {
	0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07,
	0x7F, 0x67, 0x77, 0x7C, 0x39, 0x5E, 0x79, 0x71};
	unsigned char hex_segs[] = {0, 0, 0, 0, 0, 0, 0, 0};
	unsigned int shift_buffer, nibble;
	unsigned char code;
	int i;
	shift_buffer = (b1 << 16) | (b2 << 8) | b3;
	for (i = 0; i < 6; ++i) {
		nibble = shift_buffer & 0x0000000F; // character is in rightmost nibble
		code = seven_seg_decode_table[nibble];
		hex_segs[i] = code;
		shift_buffer = shift_buffer >> 4;
	}
	/* drive the hex displays */
	*(HEX3_HEX0_ptr) = *(int *)(hex_segs);
	*(HEX5_HEX4_ptr) = *(int *)(hex_segs + 4);
}

void move(int direction){
	int x = player_x;
	int distant_x = x;
	int y = player_y;
	int distant_y = y;
	if(direction == UP){
		player_direction = UP;
		y--;
		distant_y -= 2;
	}else if(direction == DOWN){
		player_direction = DOWN;
		y++;
		distant_y += 2;
	}else if(direction == LEFT){
		player_direction = LEFT;
		x--;
		distant_x -= 2;
	}else if(direction == RIGHT){
		player_direction = RIGHT;
		x++;
		distant_x += 2;
	}
	int isPassive = interact(x,y);
	if(isPassive){
		if( !(distant_x > 12 || distant_x < 0 || distant_y > 12 || distant_y < 0) ){
			int entity = entityMap[player_floor][distant_x][distant_y];
			if((entity > 8 && entity < 13) || (entity == BOSS)){
				if(current_enemy == -1){
					createCurrent(distant_x, distant_y);
				}
			}				
		}
		if(current_enemy != -1){
			current_enemy_health = (int)(getEnemyHealth[current_enemy] + (((player_floor+1) * (getEnemyHealth[current_enemy] * 0.1))));
		}
	}

}

int interact(int x, int y){
	int isPassive = 1;
	if( !(x > 12 || x < 0 || y > 12 || y < 0) ){
		switch (entityMap[player_floor][x][y]){
			case NONE:
				player_x = x;
				player_y = y;
				break;
			 
			case WALL:
				break;
			 
			case POTION:
				entityMap[player_floor][x][y] = NONE;
				player_health += 25 + (25 * (player_floor + 1));
				player_x = x;
				player_y = y;
				break;
			
			case KEY:
				entityMap[player_floor][x][y] = NONE;
				player_keys++;
				player_x = x;
				player_y = y;
				break;
			
			case WEAPON:
				entityMap[player_floor][x][y] = NONE;
				player_weapon++;
				player_x = x;
				player_y = y;
				break;
			
			case SHIELD:
				entityMap[player_floor][x][y] = NONE;
				player_shield++;
				player_x = x;
				player_y = y;
				break;
			
			case DOOR:
				if(player_keys >= 1){
					entityMap[player_floor][x][y] = NONE;
					player_keys--;
					player_x = x;
					player_y = y;
					draw_UI();
					draw_floor();
				}
				break;
			
			case GO_UP:
				player_floor++;
				player_x = player_start_points_x[player_floor];
				player_y = player_start_points_y[player_floor];
				break;
				
			case GO_DOWN:
				player_floor--;
				player_x = player_end_points_x[player_floor];
				player_y = player_end_points_y[player_floor];
				break;
				
			case KNIGHT:	
			case GHOST:	
			case VAMPIRE:
			case SKELLY:
			case BOSS:
				isPassive = 0;
				createCurrent(x, y);
				attackEnemy();
				break;
			case GOLD:
				entityMap[player_floor][x][y] = NONE;
				player_gold += (1+player_floor) * 10;
				player_x = x;
				player_y = y;
				break;
			
			default:
				break;
		}
	}
	return isPassive;
}


void createCurrent(int x, int y){
	if(current_enemy == -1 || current_enemy_health == (int)(getEnemyHealth[current_enemy] + ((	(player_floor+1) * (getEnemyHealth[current_enemy] * 0.1))))){
		if(entityMap[player_floor][x][y] == BOSS){
			current_enemy = 5;
		}else{
			current_enemy = (entityMap[player_floor][x][y] - 8);
		}
		current_enemy_health = (int)(getEnemyHealth[current_enemy] + 	(((player_floor+1) * (getEnemyHealth[current_enemy] 	*	0.1)	)));
		current_enemy_attack = (int)(getEnemyAttack[current_enemy] + 	(((player_floor+1) * (getEnemyAttack[current_enemy] 	* 	0.1)	)));
		current_enemy_defence = (int)(getEnemyDefence[current_enemy] + 	(((player_floor+1) * (getEnemyDefence[current_enemy] 	* 	0.1)	)));
		current_enemy_x = x;
		current_enemy_y = y;
	}			
}

void clearCurrent(){
	current_enemy = -1;
	current_enemy_health = 0;
	current_enemy_attack = 0;
	current_enemy_defence = 0;
	current_enemy_x = -1;
	current_enemy_y = -1;	
}

void attackEnemy(){
	int attack_damage = (player_attack + ((player_weapon) * 30)) - current_enemy_defence;
	if(attack_damage > 0){
		current_enemy_health -= attack_damage;
	}
	if(current_enemy_health > 0){
		int enemy_damage = (current_enemy_attack - (player_defence + ((player_shield) * 15)));
		if(enemy_damage > 0){
			player_health -= enemy_damage;
		}
	}else{
		if(current_enemy == 5){
			entityMap[9][4][5] = NONE;
			entityMap[9][5][5] = NONE;
			entityMap[9][4][6] = NONE;
			entityMap[9][5][6] = NONE;
			gameWon = 1;
			bossDefeated = 1;
			clearCurrent();
			endScreen();	
		}else{
		entityMap[player_floor][current_enemy_x][current_enemy_y] = NONE;
		player_x = current_enemy_x;
		player_y = current_enemy_y;
		clearCurrent();
		}
	}
}

